CREATE TABLE CINE.PELICULAS_COMPLETO (
    ID_PELI          NUMBER(3),
    TITULO           VARCHAR2(40),
    DURACION         INTERVAL DAY(2) TO SECOND(6),
    NOMBRE_CRITICO   VARCHAR2(30),
    APELLIDO_CRITICO VARCHAR2(30),
    ESTRELLAS        NUMBER(1),
    FECHA            DATE,
    PAISES           VARCHAR2(3000),
    LENGUA           VARCHAR2(30)
)
/

COMMIT;